(304, '2016028', 'TRIJEZ-JNE-2016-028', 'Partido de la Revolución Democrática.', '2016-06-20', '19:20:00', 'I', 4, 'De acuerdo a la votación obtenida por cada uno de ellos, en el proceso electoral 2015/2016, y se expiden las constancias de asignación correspondientes.', 0, , 1, 'P', NULL, 25, 'En contra del acuerdo por el que se aprueba el cómputo Estatal de la elección de Diputados por el principio de Representación Proporcional, donde se declara su validez y se asignan las diputaciones que por ese principio les corresponde.', 'Consejo General del Instituto Electoral del Estado de Zacatecas.', '', 2, '', 1, 'DRP'),
(305, '2016029', 'TRIJEZ-JNE-2016-029', 'Partido Verde Ecologista de México.', '2016-06-20', '19:22:00', 'I', 4, 'que por este principio les corresponden de acuerdo a la votación obtenida por cada una de ellos,,en el proceso electoral 2015/2016, y se expiden las constancias de los partidos políticos.', 0, , 1, 'P', NULL, 25, 'En contra del acuerdo  ACG-IEEZ-072/VI/2016  por el que se aprueba el cómputo Estatal de la elección de Diputados por el principio de Representación Proporcional, se declara su validez y se asignan las Diputaciones por este principio. ', 'Consejo General del Instituto Electoral del Estado de Zacatecas.', '', 2, '', 1, 'DRP'),
